import ClientPanel from "../pages/ClientPanel";
import AbcientPage from "../pages/AbcientPage";
import Footer from "./Footer";
import {Outlet} from "react-router-dom";
import Header from "./Header";
import axios from "axios";
import React, {useState} from "react";
import ProtectedRoute from "./ProtectedRoute";

function Root(){
    const [dataStudentsContext, setDataStudentsContext] = useState([])
    return(
        <div className="Main">
            <Header nameApp={'Классный помощник'}/>
                <ProtectedRoute children={<Outlet context={[dataStudentsContext,setDataStudentsContext]} />}/>
            <Footer/>
        </div>
    )
}
export default Root;
